function Logout() {

    function handleLogout() {
        localStorage.removeItem('loggedIn');
        localStorage.removeItem('user');
        localStorage.removeItem('token');
        navigate('/login');
    }

    return (
        <div>
            {handleLogout()}
        </div>
    )
}

export default Logout;
